  var video = document.createElement("video");
  var canvasElement = document.getElementById("canvas");
  var canvas = canvasElement.getContext("2d");
  var loadingMessage = document.getElementById("loadingMessage");
  var outputContainer = document.getElementById("output");
  var outputMessage = document.getElementById("outputMessage");
  var outputData = document.getElementById("outputData");

  function drawLine(begin, end, color) {
    canvas.beginPath();
    canvas.moveTo(begin.x, begin.y);
    canvas.lineTo(end.x, end.y);
    canvas.lineWidth = 4;
    canvas.strokeStyle = color;
    canvas.stroke();
  }

  // Use facingMode: environment to attemt to get the front camera on phones
  navigator.mediaDevices.getUserMedia({ video: { facingMode: "environment" } })
      .then(function(stream) {
          video.srcObject = stream;
          video.setAttribute("playsinline", true); // required to tell iOS safari we don't want fullscreen
          video.play();
    //requestAnimationFrame(tick);
  });

  function tick() {
    loadingMessage.innerText = "⌛ Kamerazugriff anfragen..."
    if (video.readyState === video.HAVE_ENOUGH_DATA) {
      loadingMessage.hidden = true;
      canvasElement.hidden = false;
      //outputContainer.hidden = false;

      canvasElement.height = video.videoHeight;
      canvasElement.width = video.videoWidth;
      canvas.drawImage(video, 0, 0, canvasElement.width, canvasElement.height);
      var imageData = canvas.getImageData(0, 0, canvasElement.width, canvasElement.height);
      var code = jsQR(imageData.data, imageData.width, imageData.height, {
        inversionAttempts: "dontInvert",
      });
      if (code)
      {
          //$('#ticketResult').html(" ");
          //$('#ticketResult').css('background-color', '#AAAAAA');

  
        drawLine(code.location.topLeftCorner, code.location.topRightCorner, "#FF3B58");
        drawLine(code.location.topRightCorner, code.location.bottomRightCorner, "#FF3B58");
        drawLine(code.location.bottomRightCorner, code.location.bottomLeftCorner, "#FF3B58");
        drawLine(code.location.bottomLeftCorner, code.location.topLeftCorner, "#FF3B58");
        //outputMessage.hidden = true;
        //outputData.parentElement.hidden = false;
           
      code=code.data;
      code=code.split(" ");
      if (code[1]) code=code[1]; else code=code[0];
      $('#outputData').html("Code: "+code);
      // Check EventCode
       if (!eventID)
      {
              api("e",code);
            }else{
              api("t",code);
            }
      } else {
        //outputMessage.hidden = false;
        //outputData.parentElement.hidden = true;
      }
    }
    requestAnimationFrame(tick);
  }
  
  function startScanning()
  {
      if (getCookie("scannerEID")!=null) api("e",getCookie("scannerEID"));
      requestAnimationFrame(tick);
  }
  
  function api(mode,code)
  {
      if (!code) return;
      if (lastCode==code && lastMode==mode) return; // sonst abbruch
      lastCode=code;
      lastMode=mode;
      clearTimeout(timeOutID);
      
      console.log("SCAN: "+mode+": "+code);
      $.post( "/scanner/api.php?"+mode+"="+code, function( data ) {
          data=JSON.parse(data);
          //lastCode=mode+" "+code;
          if (mode=="reset")
          {
              location.reload();
              eraseCookie("scannerEID");
          }
              
          // EventCode
          if (data['eI']>0)
          {
              eventID=data['eI'];
              $('#eventData').html("<h2>"+data['eT']+"</h2><h3>"+data['eD']+"</h3>");
              $('#outputMessage').html("QR-Code auf dem Ticket scannen");
              $('#ticketResult').html("<h1>Scanner<br />einsatzbereit</h1>");
              setCookie("scannerEID",code,7);
              lastMode="t"; // Sonderfall, damit nicht EventCode als Ticket versucht wird
          }else{
              if (data['action']=="out?")
                  out="<hr><button onclick=\"api('o','"+code+"');\">Ticket freigeben</button>";
              else
                  out="";
              $('#ticketResult').html("<h1>"+data['sign']+"</h1><h2>"+nl2br(data['message'])+"</h2>"+out);
              $('#ticketResult').css('background-color', data['color']);
          }
          $('#eventInfo').html(data['eventInfo']);
          console.log(data);//alert(data);$( ".result" ).html( data );

          if (data['vibrate']==1){ window.navigator.vibrate([500]); beep(1); }
          if (data['vibrate']==2){ window.navigator.vibrate([150,50,150]); beep(2); }
          if (data['vibrate']==3){ window.navigator.vibrate([100,30,100,30,100]);  beep(0); }


          // Nach X Sekunden Doppelscannschutz löschen, falls Nutzer direkt danach wieder verlassen möchte
          timeOutID=setTimeout(function(){lastCode="";lastMode="";$('#ticketResult').css('background-color', '#AAAAAA');},3000);
      });	
  
  }

function nl2br (str)
{
  if (typeof str === 'undefined' || str === null)
      return '';
  
  return (str + '').replace(/([^>\r\n]?)(\r\n|\n\r|\r|\n)/g, '$1' + '<br />' + '$2');
}

function setCookie(name,value,days) {
  var expires = "";
  if (days) {
      var date = new Date();
      date.setTime(date.getTime() + (days*24*60*60*1000));
      expires = "; expires=" + date.toUTCString();
  }
  document.cookie = name + "=" + (value || "")  + expires + "; path=/";
}
function getCookie(name) {
  var nameEQ = name + "=";
  var ca = document.cookie.split(';');
  for(var i=0;i < ca.length;i++) {
      var c = ca[i];
      while (c.charAt(0)==' ') c = c.substring(1,c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
  }
  return null;
}
function eraseCookie(name) {   
  document.cookie = name +'=; Path=/; Expires=Thu, 01 Jan 1970 00:00:01 GMT;';
}


